
            
            <!DOCTYPE html>
<html>
<head>
	<title>Login Page</title>
	<style>

	.container {
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
}

.card {
  margin: 20px;
  padding: 10px;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  text-align: center;
  max-width: 300px;
  min-width: 250px;
  float: left;
}

.card img {
  width: 100%;
  height: 200px;
  object-fit: cover;
  margin-bottom: 10px;
}

.button {
  display: block;
  margin: 10px auto;
  padding: 10px;
  background-color: #4CAF50;
  color: white;
  border: none;
  cursor: pointer;
  border-radius: 5px;
  font-size: 16px;
  text-decoration: none;
}

.button:hover {
  background-color: #3e8e41;
}


	</style>
</head>
<body>
<div class="card">
    <img src="data:image/png;base64," alt="Image 1">
    <a href="{{ route('superadmin.login') }}" class="button">Click here for superadmin login</a>
</div>

<div class="card">
    <img src="data:image/png;base64," alt="Image 1">
    <a href="{{ route('admin.login') }}" class="button">Click here for admin login</a>
</div>
<div class="card">
    <img src="data:image/png;base64," alt="Image 1">
    <a href="{{ route('user.login') }}" class="button">Click here for user login</a>
</div>





		
</body>
</html>


            